import React, { useState } from "react";
import axios from "axios";


function Registration(){
    const [status, setStatus] = useState({username: '', email: ''});

    function handleChange(e){
        const {name, value} = e.target;
        setStatus(prevState => ({
            ...prevState,
            [name]: value
         }));
    }


    function handleSubmit(e){
        axios
            .post("/users/", status)
            .catch((error) => {
                console.log(error.response);
            });
    }

    return(
        <div>
            <form onSubmit = {handleSubmit}>
                <label>
                    Email:<br/>
                    <input type="text" value={status.email} onChange= {(e) => handleChange(e)} name = "email"/><br/>
                </label>
                <label>
                    Username:<br/>
                    <input type="text" value={status.username} onChange={(e) => handleChange(e)} name = "username"/><br/>
                </label>
                {/* <label>
                    Password:<br/>
                    <input type="text" value={status.password} onChange={(e) => handleChange(e)} name = "password"/><br/>
                </label> */}
                <input type = "submit" value = "Submit"></input>
            </form>
        </div>
    );
}


export default Registration;
